#Function to insert bikes into a given database
def insert_customersANDbooks_into_database(db_url):
    try:
        # Connect to the database using the database URL
        conn = psycopg2.connect(db_url)
        cur = conn.cursor()

		#Insert bikes into the table
        cur.executemany(insert_command_customer, customers_to_insert)
        cur.executemany(insert_command_book, book_to_insert)

		#Commit the changes
        conn.commit()

        print(f"customers and books inserted successfully into database: {db_url}")
    except psycopg2.DatabaseError as e:
        print(f"An error occurred in database {db_url}: {e}")
    finally:
        # Ensure that the database connection is closed
        if cur: cur.close()
        if conn: conn.close()

insert_customersANDbooks_into_database(db_url) 